import { createStore } from 'vuex'

export default createStore({
  state: {
    repo1_name: 'repoooo1',
    repo2_name: 'repoooo2',

  },
  getters: {
    getTime(state){
      return state.time
    },
    getRepo1Name(state){
      return state.repo1_name
    },
    getRepo2Name(state){
      return state.repo2_name
    },
  },
  mutations: {
    setTime(state, time){
      state.time = time
    }
  },
  actions: {

  },
  modules: {
  }
})
